export const SHOW_MY_LEARNING_TOOLTIP = "SHOW_MY_LEARNING_TOOLTIP";


export const showMyLearningToolTip = (data) => ({
    type: SHOW_MY_LEARNING_TOOLTIP,
    data: data
})
